/*

DROP SCHEMA if exists HR;
DROP SCHEMA if exists Production;
DROP SCHEMA if exists Sales;
DROP SCHEMA if exists Stats;
DROP SCHEMA if exists Ora;

*/

CREATE SCHEMA HR;
CREATE SCHEMA Production;
CREATE SCHEMA Sales;
CREATE SCHEMA Stats;
CREATE SCHEMA Ora;

---------------------------------------------------------------------
-- Drop Tables
---------------------------------------------------------------------
Drop TABLE if exists Stats.Scores;
Drop TABLE if exists Stats.Tests;
Drop TABLE if exists Sales.OrderDetails;
Drop TABLE if exists Sales.Orders;
Drop TABLE if exists Sales.Shippers;
Drop TABLE if exists Sales.Customers;
Drop TABLE if exists Production.Products;
Drop TABLE if exists Production.Categories;
Drop TABLE if exists Production.Suppliers;
Drop TABLE if exists HR.Employees;

---------------------------------------------------------------------
-- Create Tables
---------------------------------------------------------------------

-- Create table HR.Employees
CREATE TABLE HR.Employees
(
  empid           INT          NOT NULL,
  lastname        VARCHAR(20) NOT NULL,
  firstname       VARCHAR(10) NOT NULL,
  title           VARCHAR(30) NOT NULL,
  titleofcourtesy VARCHAR(25) NOT NULL,
  birthdate       DATE     NOT NULL,
  hiredate        DATE     NOT NULL,
  address         VARCHAR(60) NOT NULL,
  city            VARCHAR(15) NOT NULL,
  region          VARCHAR(15) NULL,
  postalcode      VARCHAR(10) NULL,
  country         VARCHAR(15) NOT NULL,
  phone           VARCHAR(24) NOT NULL,
  mgrid           INT          NULL,
  CONSTRAINT PK_Employees PRIMARY KEY(empid),
  CONSTRAINT FK_Employees_Employees FOREIGN KEY(mgrid)
    REFERENCES HR.Employees(empid),
  CONSTRAINT CHK_birthdate CHECK(birthdate <= CURRENT_TIMESTAMP)
);

CREATE INDEX idx_nc_lastname   ON HR.Employees(lastname);
CREATE INDEX idx_nc_postalcode ON HR.Employees(postalcode);

-- Create table Production.Suppliers
CREATE TABLE Production.Suppliers
(
  supplierid   INT          NOT NULL,
  companyname  VARCHAR(40) NOT NULL,
  contactname  VARCHAR(30) NOT NULL,
  contacttitle VARCHAR(30) NOT NULL,
  address      VARCHAR(60) NOT NULL,
  city         VARCHAR(15) NOT NULL,
  region       VARCHAR(15) NULL,
  postalcode   VARCHAR(10) NULL,
  country      VARCHAR(15) NOT NULL,
  phone        VARCHAR(24) NOT NULL,
  fax          VARCHAR(24) NULL,
  CONSTRAINT PK_Suppliers PRIMARY KEY(supplierid)
);

CREATE INDEX idx_nc_companyname ON Production.Suppliers(companyname);
CREATE INDEX idx_nc_postalcode  ON Production.Suppliers(postalcode);

-- Create table Production.Categories
	CREATE TABLE Production.Categories
(
  categoryid   INT           NOT NULL,
  categoryname VARCHAR(15)  NOT NULL,
  description  VARCHAR(200) NOT NULL,
  CONSTRAINT PK_Categories PRIMARY KEY(categoryid)
);

CREATE INDEX categoryname ON Production.Categories(categoryname);

-- Create table Production.Products
-- Drop TABLE Production.Products;
CREATE TABLE Production.Products
(
  productid    INT          NOT NULL,
  productname  VARCHAR(40) NOT NULL,
  supplierid   INT          NOT NULL,
  categoryid   INT          NOT NULL,
  unitprice numeric(19,4)   NOT NULL
    CONSTRAINT DFT_Products_unitprice DEFAULT(0),
  discontinued numeric(3,0)          NOT NULL 
    CONSTRAINT DFT_Products_discontinued DEFAULT(0),
  CONSTRAINT PK_Products PRIMARY KEY(productid),
  CONSTRAINT FK_Products_Categories FOREIGN KEY(categoryid)
    REFERENCES Production.Categories(categoryid),
  CONSTRAINT FK_Products_Suppliers FOREIGN KEY(supplierid)
    REFERENCES Production.Suppliers(supplierid),
  CONSTRAINT CHK_Products_unitprice CHECK(unitprice >= 0)
);

CREATE INDEX idx_nc_categoryid  ON Production.Products(categoryid);
CREATE INDEX idx_nc_productname ON Production.Products(productname);
CREATE INDEX idx_nc_supplierid  ON Production.Products(supplierid);

-- Create table Sales.Customers
CREATE TABLE Sales.Customers
(
  custid       INT          NOT NULL,
  companyname  VARCHAR(40) NOT NULL,
  contactname  VARCHAR(30) NOT NULL,
  contacttitle VARCHAR(30) NOT NULL,
  address      VARCHAR(60) NOT NULL,
  city         VARCHAR(15) NOT NULL,
  region       VARCHAR(15) NULL,
  postalcode   VARCHAR(10) NULL,
  country      VARCHAR(15) NOT NULL,
  phone        VARCHAR(24) NOT NULL,
  fax          VARCHAR(24) NULL,
  CONSTRAINT PK_Customers PRIMARY KEY(custid)
);

CREATE INDEX idx_nc_city        ON Sales.Customers(city);
CREATE INDEX idx_nc_companyname ON Sales.Customers(companyname);
CREATE INDEX idx_nc_postalcode  ON Sales.Customers(postalcode);
CREATE INDEX idx_nc_region      ON Sales.Customers(region);

-- Create table Sales.Shippers
CREATE TABLE Sales.Shippers
(
  shipperid   INT          NOT NULL,
  companyname VARCHAR(40) NOT NULL,
  phone       VARCHAR(24) NOT NULL,
  CONSTRAINT PK_Shippers PRIMARY KEY(shipperid)
);

-- Create table Sales.Orders
CREATE TABLE Sales.Orders
(
  orderid        INT          NOT NULL,
  custid         INT          NULL,
  empid          INT          NOT NULL,
  orderdate      TIMESTAMP    NOT NULL,
  requireddate   TIMESTAMP    NOT NULL,
  shippeddate    TIMESTAMP    NULL,
  shipperid      INT          NOT NULL,
  freight        MONEY        NOT NULL
    CONSTRAINT DFT_Orders_freight DEFAULT(0),
  shipname       VARCHAR(40) NOT NULL,
  shipaddress    VARCHAR(60) NOT NULL,
  shipcity       VARCHAR(15) NOT NULL,
  shipregion     VARCHAR(15) NULL,
  shippostalcode VARCHAR(10) NULL,
  shipcountry    VARCHAR(15) NOT NULL,
  CONSTRAINT PK_Orders PRIMARY KEY(orderid),
  CONSTRAINT FK_Orders_Customers FOREIGN KEY(custid)
    REFERENCES Sales.Customers(custid),
  CONSTRAINT FK_Orders_Employees FOREIGN KEY(empid)
    REFERENCES HR.Employees(empid),
  CONSTRAINT FK_Orders_Shippers FOREIGN KEY(shipperid)
    REFERENCES Sales.Shippers(shipperid)
);

CREATE INDEX idx_nc_custid         ON Sales.Orders(custid);
CREATE INDEX idx_nc_empid          ON Sales.Orders(empid);
CREATE INDEX idx_nc_shipperid      ON Sales.Orders(shipperid);
CREATE INDEX idx_nc_orderdate      ON Sales.Orders(orderdate);
CREATE INDEX idx_nc_shippeddate    ON Sales.Orders(shippeddate);
CREATE INDEX idx_nc_shippostalcode ON Sales.Orders(shippostalcode);

-- Create table Sales.OrderDetails
CREATE TABLE Sales.OrderDetails
(
  orderid   INT           NOT NULL,
  productid INT           NOT NULL,
  unitprice NUMERIC(19, 3)         NOT NULL
    CONSTRAINT DFT_OrderDetails_unitprice DEFAULT(0),
  qty       SMALLINT      NOT NULL
    CONSTRAINT DFT_OrderDetails_qty DEFAULT(1),
  discount  NUMERIC(4, 3) NOT NULL
    CONSTRAINT DFT_OrderDetails_discount DEFAULT(0),
  CONSTRAINT PK_OrderDetails PRIMARY KEY(orderid, productid),
  CONSTRAINT FK_OrderDetails_Orders FOREIGN KEY(orderid)
    REFERENCES Sales.Orders(orderid),
  CONSTRAINT FK_OrderDetails_Products FOREIGN KEY(productid)
    REFERENCES Production.Products(productid),
  CONSTRAINT CHK_discount  CHECK (discount BETWEEN 0 AND 1),
  CONSTRAINT CHK_qty  CHECK (qty > 0),
  CONSTRAINT CHK_unitprice CHECK (unitprice >= 0)
);

CREATE INDEX idx_nc_orderid   ON Sales.OrderDetails(orderid);
CREATE INDEX idx_nc_productid ON Sales.OrderDetails(productid);

-- Create table Stats.Tests
CREATE TABLE Stats.Tests
(
  testid    VARCHAR(10) NOT NULL,
  CONSTRAINT PK_Tests PRIMARY KEY(testid)
);

-- Create table Stats.Scores
CREATE TABLE Stats.Scores
(
  testid    VARCHAR(10) NOT NULL,
  studentid VARCHAR(10) NOT NULL,
  score     INT     NOT NULL
    CONSTRAINT CHK_Scores_score CHECK (score BETWEEN 0 AND 100),
  CONSTRAINT PK_Scores PRIMARY KEY(testid, studentid),
  CONSTRAINT FK_Scores_Tests FOREIGN KEY(testid)
    REFERENCES Stats.Tests(testid)
);

CREATE INDEX idx_nc_testid_score ON Stats.Scores(testid, score);

