Go

--CTEs ile cozum

with TabloA as
(
	Select e1.firstname, e1.Lastname, e1.Salary,e1.empid,e1.department_id

	From Dummy.EmployeesSalary as e1
	Where e1.salary < 

				(
					Select max(e2.salary) --,e2.department_id
					From Dummy.EmployeesSalary as e2
					Where e2.department_id = e1.department_id
					Group By e2.department_id	

				)
)
Select department_id, MAX(salary) as Mak_2maas
From TabloA
Group By department_id;

--derived table ile çözüm

Select department_id, MAX(salary) as Mak_2maas
From
		(
			Select e1.firstname, e1.Lastname, e1.Salary,e1.empid,e1.department_id

			From Dummy.EmployeesSalary as e1
			Where e1.salary < 

						(
