--Drop Table Dummy.Kisiler
Create Table Dummy.Kisiler
(
	id int Primary Key,
	Ad varchar(30),
	Soyad varchar(30),
	Cinsiyet varchar(1),
	Sehir varchar(30),
	ilce varchar(30),
	TelNO char(11),
	TCNO char(11),
	DogumTarihi date,
	Yas tinyint,
	YasGrubu varchar(11),
	Maas Money
);
