--Kisiler Tablosuna veri eklemek icin Stored Procedure Uretecegiz

--Drop Proc if exists Dummy.Proc_KisilerOtomatikUret;
--Go

Create Proc Dummy.Proc_KisilerOtomatikUret(@KisiSayisi as int)
--Bu Stored Procedure ile otomatik olarak kisiler tablosuna veri eklenecektir
as
Begin
	SET NOCOUNT ON;

	Declare @i int = 0
	Declare @Ad varchar(30) = ''
	Declare @Soyad varchar(30) = ''
	Declare @Cinsiyet varchar(1) = ''
	Declare @Sehir varchar(30) = ''
	Declare @ilce varchar(30) = ''
	Declare @TCNO varchar(11) = ''
	Declare @TELNO varchar(11) = ''
	Declare @DogumTarihi date = ''
	Declare @Yas tinyint = ''
	Declare @YasGrubu varchar(11) = ''
	Declare @Maas Money = ''

	Declare @max_isim int = (Select Count(*) From Dummy.isimler)
	Declare @max_soyisim int = (Select Count(*) From Dummy.Soyisimler)
	Declare @max_sehir int = (Select Count(*) From Dummy.Sehirler)

	Declare @Sehir_id int
	Declare @Sehir_ilce_id int

	--Select round(rand() * @max_isim,0)
	--Select round(rand() * @max_soyisim,0)
	--Select round(rand() * @max_sehir,0)

	While @i < @KisiSayisi
	Begin
						Select @Ad = isimler, @Cinsiyet = cinsiyet
						From Dummy.isimler
						Where id = (round(rand() * @max_isim,0))

						Select @Soyad = Soyisimler
						From Dummy.Soyisimler
						Where id = (round(rand() * @max_soyisim,0))

						Set @Sehir_id = (round(rand() * @max_sehir,0))

						Select @Sehir = Sehirler
						From Dummy.Sehirler
						Where id = @Sehir_id

						Declare @max_sehir_ilceler int = (Select Count(*) From Dummy.Ilceler Where Il_Kodu = @Sehir_id)

						Set @Sehir_ilce_id = (round(rand() * @max_sehir_ilceler,0))

						Select @ilce = Ilce_Adı
						From Dummy.Ilceler
						Where Il_Kodu = @Sehir_id and Ilce_Kodu = @Sehir_ilce_id
			
			
						Select @TCNO = Concat(Cast(Right(round(rand() * 999999,0),4) as varchar(20)),
								Cast(Right(round(rand() * 999999,0),4) as varchar(20)),
								Cast(Right(round(rand() * 999999,0),3) as varchar(20)))

						Select @TELNO = Concat('05',
								Cast(Right(round(rand() * 999999,0),5) as varchar(20)),
								Cast(Right(round(rand() * 999999,0),4) as varchar(20)))

						--
						Select @DogumTarihi= DATEADD(day,round(rand() * 23000,0), '1940-01-01')
						--1940 yılını baz alarak tarih ekliyoruz
						--1940 yılından bugune 83 yıl var ortalama 83 yıl * 365 gun = yaklasık 30.295 gun yapar
						--23.000 ile çarparak rastgele tarih uretelim

						Select @Yas = DATEDIFF(YEAR, @DogumTarihi, GETDATE())
						if @Yas < 20 set @YasGrubu = '20 nin Altı'
						if @Yas Between 21 and 30 set @YasGrubu = '20-30 Arası'
						if @Yas Between 31 and 40 set @YasGrubu = '30-40 Arası'
						if @Yas Between 41 and 50 set @YasGrubu = '40-50 Arası'
						if @Yas Between 51 and 60 set @YasGrubu = '50-60 Arası'
						if @Yas > 60 set @YasGrubu = '60 Uzeri'

						Select @Maas = round(rand() *1000,0) * 50
						if @Maas < 8000 set @Maas = @Maas + 8000

						--Select @Ad, @Soyad, @Cinsiyet, @Sehir, @DogumTarihi, @Yas, @YasGrubu, @Maas

					insert into Dummy.Kisiler(Ad, Soyad, Cinsiyet, Sehir, ilce, TCNO, TelNO, DogumTarihi, Yas, YasGrubu, Maas)
					Values(@Ad, @Soyad, @Cinsiyet, @Sehir, @ilce, @TCNO,@TELNO, @DogumTarihi, @Yas, @YasGrubu, @Maas)
					Set @i = @i + 1
	End; -- While Dongusunun
	
	SET NOCOUNT OFF;
End;
Go

